import React from "react";
import { makeStyles, useTheme } from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import CardActions from "@material-ui/core/CardActions";
import CardMedia from "@material-ui/core/CardMedia";
import Typography from "@material-ui/core/Typography";
import Chip from "@material-ui/core/Chip";
import docImg from "../../img/results/docAlex.png";
import FavoriteIcon from "@material-ui/icons/Favorite";
import IconButton from "@material-ui/core/IconButton";
import Grid from "@material-ui/core/Grid";

const useStyles = makeStyles((theme) => ({
  root: {
    display: "100%",
  },
  details: {
    display: "flex",
    flexDirection: "row",
  },
  content: {
    flex: "1 0 auto",
  },
  cover: {
    width: "100%",
    margin: 20,
    backgroundSize: "contain",
  },
  controls: {
    display: "flex",
    alignItems: "center",
    paddingLeft: theme.spacing(1),
    paddingBottom: theme.spacing(1),
  },
}));

export default function MediaControlCard() {
  const classes = useStyles();
  const theme = useTheme();

  return (
    <Card className={classes.root}>
      <div className={classes.details}>
        <Grid container spacing={0}>
          <Grid item md={4}>
            <CardMedia component="img" className={classes.cover} image={docImg}>
              {/* <img alt="doc" src={docAlex} className={classes.cover} /> */}
            </CardMedia>
          </Grid>
          <Grid item md={8} spacing={0}>
            <CardContent>
              <Typography component="h5" variant="h5" color="primary">
                Dr. Alex Leow
              </Typography>
              <Typography variant="subtitle1" color="textSecondary">
                Specialty: <span>Gastroenterology</span>
              </Typography>
              <Typography variant="subtitle1" color="textSecondary">
                Hospital: <span>Pantai Hospital Kuala Lumpur</span>
              </Typography>
              <Typography variant="subtitle1" color="textSecondary">
                Languages: <span>English, Malay, Mandarin, Cantonese</span>
              </Typography>
              <br></br>
              <Chip color="secondary" size="small" label="Private"></Chip>
            </CardContent>
          </Grid>
        </Grid>

        <CardActions>
          <IconButton aria-label="add to favorites">
            <FavoriteIcon />
          </IconButton>
        </CardActions>
      </div>
    </Card>
  );
}
